                </h1>
            <div class="header__box__desciption">for the love of <span class="muscle">creativity</span></div>
            </div>

            <div class="btn__header coolBeans">
            <a  href="#portfolioSection">Discover more</a>
            </div>
            {/* <div class="btn__header">
            <a class="btn__btn btn__btn__header btn__btn--white btn__btn--animated" href="#portfolioSection">Or just hire me!</a>
            </div> */}
        </header>
    )
}
